module actual_rhs_module

  use amrex_fort_module, only: rt => amrex_real
  use amrex_constants_module
  use physical_constants, only: N_AVO
  use network
  use table_rates
  use burn_type_module
  use partition_function_table

  implicit none

  ! Indices into rate groups in the rate_eval_t type
  integer, parameter :: i_rate        = 1
  integer, parameter :: i_drate_dt    = 2
  integer, parameter :: i_scor        = 3
  integer, parameter :: i_dscor_dt    = 4

  type :: rate_eval_t
     real(rt) :: unscreened_rates(num_rate_groups, nrates)
     real(rt) :: screened_rates(nrates)
     real(rt) :: add_energy_rate(nrat_tabular)
  end type rate_eval_t

contains

  subroutine actual_rhs_init()
    ! STUB FOR MAESTRO'S TEST_REACT. ALL THE INIT IS DONE BY BURNER_INIT
    return
  end subroutine actual_rhs_init


  subroutine update_unevolved_species(state)
    ! STUB FOR INTEGRATOR
    type(burn_t)     :: state

    !$gpu

    return
  end subroutine update_unevolved_species


  subroutine zero_rate_eval(rate_eval)

    implicit none

    type(rate_eval_t), intent(inout) :: rate_eval

    !$gpu

    rate_eval % unscreened_rates(i_rate, :) = ZERO
    rate_eval % unscreened_rates(i_drate_dt, :) = ZERO
    rate_eval % unscreened_rates(i_scor, :) = ONE
    rate_eval % unscreened_rates(i_dscor_dt, :) = ZERO
    rate_eval % screened_rates = ZERO
    rate_eval % add_energy_rate = ZERO

  end subroutine zero_rate_eval


  subroutine evaluate_rates(state, rate_eval)
    !$acc routine seq

    use reaclib_rates, only: screen_reaclib, reaclib_evaluate
    use screening_module, only: screen5, plasma_state, fill_plasma_state
    use extern_probin_module, only: use_partition_factors
    
    implicit none

    type(burn_t)     :: state
    type(rate_eval_t), intent(out) :: rate_eval
    type(plasma_state) :: pstate
    real(rt) :: Y(nspec)
    integer :: i, j
    real(rt) :: rhoy
    real(rt) :: rate, drate_dt, edot_nu
    real(rt) :: scor, dscor_dt, dscor_dd
    !Interpolated PF holder pf(1)=PF(temp); pf(2) = PF'(temp); pf(3) = PF''(temp)
    real, dimension(3) :: pf
    !$gpu

    Y(:) = state % xn(:) * aion_inv(:)
    rhoy = state % rho * state % y_e

    ! Zero out the rates
    call zero_rate_eval(rate_eval)

    ! Calculate Reaclib rates
    call fill_plasma_state(pstate, state % T, state % rho, Y)
    do i = 1, nrat_reaclib
       call reaclib_evaluate(pstate, state % T, i, rate, drate_dt)
       rate_eval % unscreened_rates(i_rate, i) = rate
       rate_eval % unscreened_rates(i_drate_dt, i) = drate_dt
    end do

    !Paritition Function
    if (use_partition_factors) then
      pf = interpolate_partition_functions(jn, state % T)
      rate_eval % unscreened_rates(i_rate, k_d__n_p) = rate_eval % unscreened_rates(i_rate, k_d__n_p) * pf(1)
      rate_eval % unscreened_rates(i_drate_dt, k_d__n_p) = rate_eval % unscreened_rates(i_drate_dt, k_d__n_p) * pf(1) + rate_eval % unscreened_rates(i_rate, k_d__n_p) * pf(2)

      pf = interpolate_partition_functions(jp, state % T)
      rate_eval % unscreened_rates(i_rate, k_d__n_p) = rate_eval % unscreened_rates(i_rate, k_d__n_p) * pf(1)
      rate_eval % unscreened_rates(i_drate_dt, k_d__n_p) = rate_eval % unscreened_rates(i_drate_dt, k_d__n_p) * pf(1) + rate_eval % unscreened_rates(i_rate, k_d__n_p) * pf(2)

      pf = interpolate_partition_functions(jd, state % T)
      rate_eval % unscreened_rates(i_rate, k_d__n_p) = rate_eval % unscreened_rates(i_rate, k_d__n_p) / pf(1)
      rate_eval % unscreened_rates(i_drate_dt, k_d__n_p) = rate_eval % unscreened_rates(i_drate_dt, k_d__n_p) / pf(1) - rate_eval % unscreened_rates(i_rate, k_d__n_p) * pf(2) / pf(1)**2

      pf = interpolate_partition_functions(jp, state % T)
      rate_eval % unscreened_rates(i_rate, k_he3__p_d) = rate_eval % unscreened_rates(i_rate, k_he3__p_d) * pf(1)
      rate_eval % unscreened_rates(i_drate_dt, k_he3__p_d) = rate_eval % unscreened_rates(i_drate_dt, k_he3__p_d) * pf(1) + rate_eval % unscreened_rates(i_rate, k_he3__p_d) * pf(2)

