      rate_eval % unscreened_rates(i_drate_dt, k_he4__n_he3) = rate_eval % unscreened_rates(i_drate_dt, k_he4__n_he3) * pf(1) + rate_eval % unscreened_rates(i_rate, k_he4__n_he3) * pf(2)

